import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Wait for product cards to be rendered by JavaScript and click the first one
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.locator('.product-card').first().click();

    // 2. Wait for the product detail modal to appear
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // 3. Click the "Add to Wish List" button inside the modal
    await page.waitForSelector('.add-to-wishlist', { timeout: 5000 });
    await page.locator('.add-to-wishlist').click();

    // 4. Wait for the success notification
    const notificationLocator = page.locator('.notification.success:has-text("Added to wishlist!")');
    await notificationLocator.waitFor({ state: 'visible', timeout: 5000 });
    const notificationText = await notificationLocator.textContent();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_confirmation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_confirmation.png'));

    // 5. Verify the item was added by checking localStorage
    const wishlistData = await page.evaluate(() => {
      return JSON.parse(localStorage.getItem('amazonWishlist'));
    });

    if (!wishlistData || wishlistData.length === 0) {
      throw new Error('Wishlist in localStorage is empty after adding an item.');
    }

    return {
      success: true,
      action: "Clicked a product, opened the detail modal, and added the product to the wishlist.",
      extractedData: {
        notificationText: notificationText.trim(),
        wishlistCount: wishlistData.length,
        firstItemTitle: wishlistData[0].title
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Capture a screenshot on failure
    const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
    await page.screenshot({ path: errorScreenshotPath });

    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots: [errorScreenshotPath],
      error: error.message
    };
  }
}
